		function what_skill($sender, $arr) {
			$bot = $this->bot->botname;
			$slot = $arr[1];
$msg = "<b>WhatBuff ".$slot." - Choose Skill :<b>\n\n";				
			foreach ($this->skills as $skill){
$msg .= "<a href='chatcmd:///tell ".$bot." !whatbuff ".$skill[0]." ".$slot."'>".$skill[1]."</a>\n";		
			}
		$blob = $this -> bot -> core("tools") -> make_blob("WhatBuff ".$slot." - Choose Skill", $msg);		
			$this -> bot -> send_tell($sender, $blob, 1, false, TRUE);
			return;
		}
		
